import React, { useContext } from 'react'
import { contextData } from './Context'

export const Label3img = () => {
    const [data]=useContext(contextData);
    const last = data[data.length-1];
    // if([data.length-1]==data.id){
    //     last = data.length-1;
    // }
console.log(data.length,data[data.length-1].image,data[34].id);
    return (
        <div className='label3'>
            <p><h1>{last.title}</h1><br/>
            <b>{last.category}</b> / {last.date}</p>
            <img src={last.image}/>
        </div>
    )
}
